import React from "react";


const NumericText = ({rows}) => {
    return (
        <section className="columnsText">
            <div className="container">
                <h2>{rows.heading}</h2>
                <div className="columns">
                    {rows.item.map((item) => {
                    return(
                        <>
                        <h2>{item.heading}</h2>
                        <div className="text">
                            <div className="item">
                                <h2 className="number"></h2>
                                <p></p>
                            </div>
                        </div>
                        </>
                    );
                    })}
                </div>
            </div>
        </section>
    );
};

export default NumericText;
